window.bookSummaryJSON = "<p><b>The truth won’t set me free - but it will probably get me killed....</b></p> <p>As Gin Blanco, aka the assassin the Spider, I’m used to having a target on my back. But ever since I started investigating the secret society known as the Circle, that target seems bigger than ever. </p> <p>Still, I’m trying to relax and enjoy the events leading up to my friends’ wedding when I learn that an old enemy has returned to Ashland. And that’s the just beginning of my latest nightmare. Soon, I have Circle goons watching my every move, but I have no choice but to continue searching for a key piece of evidence against the evil group. </p> <p>The deeper I dig, the more horrifying secrets I uncover, and the more dangerous things become for me and my friends. Just when I think I finally have a handle on things, a shocking revelation shatters my heart and leaves me with an ugly realization - that betrayal is the sharpest sting of all....</p>"; 
